package app;

import app.models.PotholeComplaintsModel;
import app.models.Status;
import app.util.PotholeComplaintServiceUtils;
import com.google.gson.Gson;
import com.google.gson.GsonBuilder;
import org.apache.commons.lang3.RandomStringUtils;

import static app.util.PotholeComplaintServiceUtils.*;

public class Main {
    public static void main(String[] args) {
        for(int i = 0; i < 10; i++) {
            System.out.println(" Complaint ID: " + generateComplaintId() + " | " + " User ID: " + generateUserId()
                    + " | " + " Latitude: " + RandomStringUtils.randomNumeric(10).toString() + " | " + " Longitude: " + RandomStringUtils.randomNumeric(10).toString()
                    + " | " + " Street Name: " + RandomStringUtils.randomAlphabetic(25) + " | " + " Nearby Landmark: " + RandomStringUtils.randomAlphabetic(10));
        }
        System.out.println("\n");
        PotholeComplaintsModel test1 = PotholeComplaintsModel.builder()
                .withComplaintId(generateComplaintId())
                .withUserId(generateUserId())
                .withLatitude(40.7579571985636)
                .withLongitude(-73.98559219631903)
                .withStreetName("Broadway")
                .withNearbyLandmark("Times Square intersection at broadway and  7th avenue")
                .withComments("Test Comments")
                .withAddedOn(getIsoDateTimeString())
                .withStatus((Status.IN_PROGRESS).toString())
                .withbase64image("")
                .build();

        System.out.println(test1);

        String isoDateTimeString = PotholeComplaintServiceUtils.getIsoDateTimeString();
        Gson gson = new GsonBuilder().setPrettyPrinting().create();
        System.out.println(isoDateTimeString);
        System.out.println(gson.toJson(test1));
    }


}